import logo from './logo.svg';
import { BrowserRouter, Routes, Route, NavLink } from "react-router-dom";
import React, { useState } from 'react';
import { Grid, Segment } from 'semantic-ui-react';
import { Home } from './component/Home/home';
import SignIn from './component/Auth/auth';
import { CardList } from './component/Market/CardList';
import { Play } from './component/Play/containers/play';


export const Main =(props) =>{
  const [user,setUser]=useState(null);
  const changeUser = (user)=>{setUser(user)}
  return (
  <>
      <BrowserRouter>
        <NavLink to="/"> Login</NavLink>
        <NavLink to="/cards"> Cards</NavLink>


          <div>
              <Routes>
                  <Route path='/home' element={<Home/>} />
                  <Route path='/cards' element={<CardList/>} />
                  <Route path='/' element={<SignIn/>} />
				          <Route path='/play' element={<Play user={user}/>} />

              </Routes>
          </div>
      </BrowserRouter>
      
  </>
);
}
export default Main;
